                />
            </DialogContent>
            <DialogActions>
                <Button onClick={handleCloseLogIn}>Cancel</Button>
                <Button onClick={handleCloseLogIn}>Log In</Button>
            </DialogActions>
        </Dialog>
    );
};

export default LogIn;
